import Header from "./components/Header";
import withDashboardContext from "./hoc/withDashboardContext";
import "./ActiveStudents.css";
import { Link, useNavigate } from "react-router-dom";
import { useAppContext } from "./context/appcontext";
import moment from "moment";
import Footer from "./components/Footer";

const ActiveStudents = () => {
  const navigate = useNavigate();
  const { activeStudents } = useAppContext();

  const suspendUser = async (id: number) => {
    console.log(id);
  };

  return (
    <div>
      <Header />
      <div
        style={{
          background: "rgb(204,204,204,.5)",
          height: "100vh",
        }}
      >
        <div
          style={{
            height: "fit-content",
            width: "70%",
            margin: "0 auto",
            paddingTop: "1rem",
          }}
        >
          <div
            style={{
              display: "flex",
              justifyContent: "space-between",
              alignItems: "center",
            }}
          >
            <button
              className="backButton"
              style={{
                borderRadius: "2px",
                padding: ".5rem 1rem",
                background: "#dc4d01",
              }}
              onClick={() => {
                navigate("/");
              }}
            >
              Back
            </button>
            <span style={{ fontSize: ".9rem" }}>
              <Link
                to={"/dashboard"}
                style={{
                  color: "black",
                  textDecoration: "none",
                  cursor: "pointer",
                }}
              >
                Home {">"}
              </Link>
              <span style={{ color: "grey" }}> All Active Users</span>
            </span>
          </div>
          <div
            style={{
              background: "white",
              padding: "1rem 1rem 2rem",
              borderTop: "3px solid blue",
              marginTop: "1rem",
            }}
          >
            <span style={{ fontSize: "1.5rem" }}>All Active Users</span>
            <table style={{ marginTop: "1rem" }}>
              <tr>
                <th>Action</th>
                <th>Name</th>
                <th>Email</th>
                <th>Access Code</th>
                <th>Registration Date</th>
                <th>Status</th>
              </tr>
              {activeStudents.map((student) => {
                return (
                  <tr>
                    <td>
                      <span
                        style={{
                          marginLeft: "1rem",
                          color: "red",
                          fontWeight: "bold",
                          cursor: "pointer",
                        }}
                        onClick={() => {
                          suspendUser(student.id);
                        }}
                      >
                        SUSPEND
                      </span>
                    </td>
                    <td>Test</td>
                    <td>{student.email}</td>
                    <td>{student.accessCode}</td>
                    <td>{moment(student.createdAt).format("LL")}</td>
                    <td>
                      <span style={{ fontWeight: "bold", color: "green" }}>
                        Active
                      </span>
                    </td>
                  </tr>
                );
              })}
            </table>
          </div>
        </div>
      </div>
      <Footer />
    </div>
  );
};

export default withDashboardContext(ActiveStudents);
